if (!window.requestAnimationFrame) {
    window.requestAnimationFrame = (function () {
        return window.webkitRequestAnimationFrame ||
          window.mozRequestAnimationFrame ||
          window.oRequestAnimationFrame ||
          window.msRequestAnimationFrame ||
          function (callback, element) {
              window.setTimeout(callback, 1000 / 60);
          };
    })();
}

document.addEventListener('tizenhwkey', function (e) {
    if (e.keyName === 'back') {
        try {
            tizen.application.getCurrentApplication().exit();
        } catch (error) { }
    }
});

var canvas = document.getElementById('canvas');
var context = canvas.getContext('2d');
var pageElement = document.getElementById('page');
var pageNum = 1;
var pageRendering = false;
var reachedEdge = false;
var touchStart = null;
var touchDown = false;
var pageNumPending = null;
var scale =1;

var lastTouchTime = 0;
var pdfFile;
var currPageNumber = 1;
var fitScale = 1;
var zoomed = false;

pageElement.addEventListener('touchstart', function (e) {
    touchDown = true;

    if (e.timeStamp - lastTouchTime < 500) {
        lastTouchTime = 0;
        toggleZoom();
    } else {
        lastTouchTime = e.timeStamp;
    }
});

pageElement.addEventListener('touchmove', function (e) {
    if (pageElement.scrollLeft === 0 ||
      pageElement.scrollLeft === pageElement.scrollWidth - page.clientWidth) {
        reachedEdge = true;
    } else {
        reachedEdge = false;
        touchStart = null;
    }

    if (reachedEdge && touchDown) {
        if (touchStart === null) {
            touchStart = e.changedTouches[0].clientX;
        } else {
            var distance = e.changedTouches[0].clientX - touchStart;
            if (distance < -100) {
                touchStart = null;
                reachedEdge = false;
                touchDown = false;
                openNextPage();
            } else if (distance > 100) {
                touchStart = null;
                reachedEdge = false;
                touchDown = false;
                openPrevPage();
            }
        }
    }
});

pageElement.addEventListener('touchend', function (e) {
    touchStart = null;
    touchDown = false;
});





function queueRenderPage(num) {
    if (pageRendering) {
        pageNumPending = num;
    } else {
        renderPage(num);
    }
};
function renderPage(num) {
    pageRendering = true;
    // Using promise to fetch the page
    pdfFile.getPage(num).then(function (page) {
        var viewport = page.getViewport(scale);
        canvas.height = viewport.height;
        canvas.width = viewport.width;

        // Render PDF page into canvas context
        var renderContext = {
            canvasContext: context,
            viewport: viewport
        };
        var renderTask = page.render(renderContext);

        // Wait for rendering to finish
        renderTask.promise.then(function () {
            pageRendering = false;
            if (pageNumPending !== null) {
                // New page rendering is pending
                renderPage(pageNumPending);
                pageNumPending = null;
            }
        });
    });

    // Update page counters
    document.getElementById('page_num').textContent = currPageNumber;
};



var toggleZoom = function () {
    zoomed = !zoomed;
    openPage(pdfFile, currPageNumber);
};


var openPage = function (pdfFile, pageNumber) {
    var scale = zoomed ? fitScale : 1;

    pdfFile.getPage(pageNumber).then(function (page) {
        viewport = page.getViewport(1);

        if (zoomed) {
            var scale = pageElement.clientWidth / viewport.width;
            viewport = page.getViewport(scale);
        }

        canvas.height = viewport.height;
        canvas.width = viewport.width;

        var renderContext = {
            canvasContext: context,
            viewport: viewport
        };

        page.render(renderContext);
    });
};
function onPrevPage() {
    if (currPageNumber <= 1) {
        return;
    }
    currPageNumber--;
    queueRenderPage(currPageNumber);
};
document.getElementById('prev').addEventListener('click', onPrevPage);
function onNextPage() {
    if (currPageNumber >= pdfFile.numPages) {
        return;
    }
    currPageNumber++;
    queueRenderPage(currPageNumber);
};
document.getElementById('next').addEventListener('click', onNextPage);
